import React, { Component } from 'react';
// import 'bootstrap/dist/css/bootstrap.min.css';
import { Header } from "./components/Header"

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            logged_in: false
        };
    }

    render() {
        return(
            <div>
                <Header logged_in={this.state.logged_in}/>
            </div>
    );
    }
}

export { App };
